INSERT INTO `category` (`id`, `name`, `code`, `description`, `group_id`) VALUES
(1, 'Animal Sciences (AS)', 'AS', 'Study of animals and animal life, including their structure, function, life history, interactions, classification, and evolution.', 1),
(2, 'Behavioral and Social Sciences (BE)', 'BE', 'The science or study of the thought processes and behavior of humans and other animals in their interactions with the environment studied through observational and experimental methods.', 10),
(3, 'Biochemistry (BI)', 'BI', 'The study of chemical substances, interactions, and processes relevant to living organisms.', 9),
(4, 'Cellular and Molecular Biology (CB)', 'CB', 'The study of the structure and formation of cells.', 11),
(5, 'Chemistry (CH)', 'CH', 'The science of the composition, structure, properties, and reactions of matter.', 9),
(6, 'Computer Science (CS)', 'CS', 'The study of information processes, the structures and procedures that represent processes, and their implementation in information processing systems. It includes systems analysis and design, application and system software design, programming, and datacenter operations.', 7),
(7, 'Earth and Planetary Science (EA)', 'EA', 'The study of sciences related to the planet Earth (Geology, minerology, physiography, oceanography, meteorology, climatology, speleology, sesismology, geography, atmospheric sciences, etc.)', 8),
(8, 'Engineering: Electrical and Mechanical (EE)', 'EE', 'The application of scientific and mathematical principles to practical ends such as the design, manufacture, and operation of efficient and economical structures, processes, and systems.', 7),
(9, 'Engineering: Materials and Bioengineering (EN)', 'EN', 'The application of scientific and mathematical principles to practical ends such as the design, manufacture, and operation of efficient and economical machines and systems.', 11),
(10, 'Energy and Transportation (ET)', 'ET', 'The study of renewable energy sources, energy efficiency, clean transport, and alternative fuels.', 7),
(11, 'Environmental Management (EM)', 'EM', 'The application of engineering principals to solve practical problems of managing mans'' interaction with the environment with the goal to maintain and improve the state of an environmental resource affected by human activities.', 9),
(12, 'Environmental Sciences (EV)', 'EV', 'The analysis of existing conditions of the environment.', 9),
(13, 'Mathematical Sciences (MA)', 'MA', 'The study of the measurement, properties, and relationships of quantities and sets, using numbers and symbols. The deductive study of numbers, geometry, and various abstract constructs, or structures.', 8),
(14, 'Medicine and Health Sciences (ME)', 'ME', 'The science of diagnosing, treating, or preventing disease and other damage to the body or mind.', 11),
(15, 'Microbiology (MI)', 'MI', 'The study of microorganisms, including bacteria, viruses, fungi, and pathogens.', 11),
(16, 'Physics and Astronomy (PH)', 'PH', 'Physics is the science of matter and energy and of interactions between the two. Astronomy is the study of anything in the universe beyond the Earth.', 8),
(17, 'Plant Sciences (PS)', 'PS', 'Study of plant life, including their structure and function, life history, growth, interactions with other plants and animals, classification, and evolution.', 11);
